import React from "react";
import ReactDOM from "react-dom";
import { Header, Main, Article, Footer } from "./index.css";
import App from "./App";

ReactDOM.render(
  <React.StrictMode>
    <Header />
    <Main />
    <Article />
    <Footer />
  </React.StrictMode>,
  document.getElementById("root")
);
